import React from 'react';
import { Button } from 'react-bootstrap'


const ProductWrapper = (props) => {
    return (
        <div className="productdesign">

            <img src={props.image} />
            <p>{props.title}</p>
            <button>View</button>
        </div>
    )
}
export default ProductWrapper;
